INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8221', 'en', 'default', 'ed3a1364a6f32d0152a9a84b1badda00', 'You can change your profile picture on <a href="%s">Gravatar</a>.', '0', '0', 'LINE', '', '10', '', 'c6a264b0634dfa17c05df0e6129f3f73', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8222', 'en', 'default', '3a94690f89aea910c66bdb3b6fff1fc0', 'You can choose from the theme&#8217;s default header images, or use one of your own. You can also customize how your Site Title and Tagline are displayed.', '0', '0', 'LINE', '', '10', '', 'a9f5169f4cc9dff9335f02dc21036a92', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8223', 'en', 'default', '60a664b6a8f309a460918c0a26f8a6c1', 'You can choose one of your previously uploaded headers, or show a random one.', '0', '0', 'LINE', '', '10', '', 'd47efcdc40344fa4bb4ed32631d75492', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8224', 'en', 'default', 'f84196c911ec5a65c48ccee53f33c850', 'You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two <a href="%s">Pages</a>. One will become the homepage, and the other will be where your posts are displayed.', '0', '0', 'LINE', '', '10', '', '649280ffbec104f0b86be27e09164287', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8225', 'en', 'default', '0754b49868a7a0ac641085882e136d75', 'You can choose whether or not your site will be crawled by robots, ping services, and spiders. If you want those services to ignore your site, click the checkbox next to &#8220;Discourage search engines from indexing this site&#8221; and click the Save Changes button at the bottom of the screen. Note that your privacy is not complete; your site is still visible on the web.', '0', '0', 'LINE', '', '10', '', '1051f547d613d166e58ee2267ea6046e', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8226', 'en', 'default', '4e171722a615bf0a18d4a10f47f71464', 'You can create groups of links by using Link Categories. Link Category names must be unique and Link Categories are separate from the categories you use for posts.', '0', '0', 'LINE', '', '10', '', '4b54c6d68320d2f035fccf562e2bab97', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8227', 'en', 'default', 'b37e44bc690a283009213e84f746d497', 'You can create the %s file manually and paste the following text into it.', '0', '0', 'LINE', '', '10', '', '76f4b68a6e9d1fcc894f1beae939aebe', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8228', 'en', 'default', '3f1914dd8eecd9de86a33cddc8389cbb', 'You can customize the display of this screen in a number of ways:', '0', '0', 'LINE', '', '10', '', '75b6f3ea46162ff1ee094bb0533bebb6', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8229', 'en', 'default', 'd6ea257fc3b6e7e133f43b11581d331a', 'You can customize the display of this screen using the Screen Options tab and/or the dropdown filters above the links table.', '0', '0', 'LINE', '', '10', '', 'e7d15f9c59ea3e6ee7f40b3c1e031594', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8230', 'en', 'default', '8ac8e55c35195400fff6756b49835523', 'You can customize the display of this screen&#8217;s contents in a number of ways:', '0', '0', 'LINE', '', '10', '', '7ed2cb9c4a7f52993516725cd5168e1c', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8231', 'en', 'default', 'ea5fcb3e59f97c7e70111b588d78d687', 'You can customize the look of your site without touching any of your theme&#8217;s code by using a custom background. Your background can be an image or a color.', '0', '0', 'LINE', '', '10', '', 'b39450760894637b67668aae44c27c96', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8232', 'en', 'default', '5aaf5b7354c090ad1a53700fdd8fe022', 'You can delete Link Categories in the Bulk Action pull-down, but that action does not delete the links within the category. Instead, it moves them to the default Link Category.', '0', '0', 'LINE', '', '10', '', 'b8541d8f687d12a898125b597c36ca87', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8233', 'en', 'default', '319980b189e432ee59526496b2fc7bd7', 'You can edit the image while preserving the thumbnail. For example, you may wish to have a square thumbnail that displays just a section of the image.', '0', '0', 'LINE', '', '10', '', '84a98079b9b86c1c74f975e3e854fa1b', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8234', 'en', 'default', '29a977dfe4c91dbbb1970d8a38a81a2a', 'You can edit the information left in a comment if needed. This is often useful when you notice that a commenter has made a typographical error.', '0', '0', 'LINE', '', '10', '', '995b8ae48206399e7a9530a8154fbbd3', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8235', 'en', 'default', 'd5fb0f5d059e20b79f51ba2cb67696b2', 'You can enable distraction-free writing mode using the icon to the right. This feature is not available for old browsers or devices with small screens, and requires that the full-height editor be enabled in Screen Options.', '0', '0', 'LINE', '', '10', '', 'dda7292d6cc6432d85981a7dcd8632bc', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8236', 'en', 'default', '439e85bf8c00d0e5d97a3f08a503f1ce', 'You can export a file of your site&#8217;s content in order to import it into another installation or platform. The export file will be an XML file format called WXR. Posts, pages, comments, custom fields, categories, and tags can be included. You can choose for the WXR file to include only certain posts or pages by setting the dropdown filters to limit the export by category, author, date range by month, or publishing status.', '0', '0', 'LINE', '', '10', '', '9588f209116dc30d63fdf43bb35e6897', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8237', 'en', 'default', '893b004b3b255507cc8437e21994eadb', 'You can filter the list of posts by post status using the text links above the posts list to only show posts with that status. The default view is to show all posts.', '0', '0', 'LINE', '', '10', '', '014d2d802fc8f834f23987d4b037d30a', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8238', 'en', 'default', '336a3ba49f4fd88e0d9f10b69511d0df', 'You can filter the list of users by User Role using the text links above the users list to show All, Administrator, Editor, Author, Contributor, or Subscriber. The default view is to show all users. Unused User Roles are not listed.', '0', '0', 'LINE', '', '10', '', '8653fbcfa867f1c95e2d3b856e2d8b47', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8239', 'en', 'default', '415205a59aff75e660caf73215b1dce4', 'You can find additional themes for your site by using the Theme Browser/Installer on this screen, which will display themes from the <a href="%s">WordPress Theme Directory</a>. These themes are designed and developed by third parties, are available free of charge, and are compatible with the license WordPress uses.', '0', '0', 'LINE', '', '10', '', 'b7b2dd7c837caf0e94c8104888321a73', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8240', 'en', 'default', '2a4f1cc2e99d292a9132ee9cfb9c3b26', 'You can find new plugins to install by searching or browsing the directory right here in your own Plugins section.', '0', '0', 'LINE', '', '10', '', 'f21a09c0e4a3b3eee841ef6b410151fa', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8241', 'en', 'default', 'd6e863468c3551518fa205b1060b3cf3', 'You can hide/display columns based on your needs and decide how many posts to list per screen using the Screen Options tab.', '0', '0', 'LINE', '', '10', '', '767d49624cffb7efeb180fe4bdd5e07a', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8242', 'en', 'default', '67e7c46d3d5c2108c0e99ceea6441dee', 'You can hide/display columns based on your needs and decide how many users to list per screen using the Screen Options tab.', '0', '0', 'LINE', '', '10', '', '48e4f7cb4f7122f5b317b5c99b0da496', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8243', 'en', 'default', 'de8768b94597e0280a0f1177f2e46900', 'You can insert media files by clicking the icons above the post editor and following the directions. You can align or edit images using the inline formatting toolbar available in Visual mode.', '0', '0', 'LINE', '', '10', '', 'c495912a27038b213ad535fd59f27db5', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8244', 'en', 'default', 'b9ee24b2ed698a7774a132f859a7440b', 'You can log out of other devices, such as your phone or a public computer, by clicking the Log Out Everywhere Else button.', '0', '0', 'LINE', '', '10', '', '1b241a88804ad03a64423db084510037', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8245', 'en', 'default', '74ec803b504414d42126006142f54490', 'You can manage comments made on your site similar to the way you manage posts and other content. This screen is customizable in the same ways as other management screens, and you can act on comments using the on-hover action links or the Bulk Actions.', '0', '0', 'LINE', '', '10', '', '054e0c1e1a79152711e5105dee4b047f', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8246', 'en', 'default', '82169939daa05d25d68df1a2d649d306', 'You can narrow the list by file type/status or by date using the dropdown menus above the media table.', '0', '0', 'LINE', '', '10', '', 'db58d14d2240eb7c402d9fbd316f6e77', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8247', 'en', 'default', 'ae310675793fc7bfa950b8760f79a4f1', 'You can now manage and live-preview Custom Backgrounds in the <a href="%1$s">Customizer</a>.', '0', '0', 'LINE', '', '10', '', '7cb915125bad49f15eac14767efbd6ce', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8248', 'en', 'default', '5c71e77cf2c930baea8c287753a229c2', 'You can now manage and live-preview Custom Header in the <a href="%1$s">Customizer</a>.', '0', '0', 'LINE', '', '10', '', 'a7882a3b8d2131be6d89949cc08d58da', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8249', 'en', 'default', '82deca0fb59319be08a217a38bcd7d23', 'You can proportionally scale the original image. For best results, scaling should be done before you crop, flip, or rotate. Images can only be scaled down, not up.', '0', '0', 'LINE', '', '10', '', 'f8773edde68d4c1d2cea0cef4a3554d0', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8250', 'en', 'default', 'a4e5684835acb802ee3194c309c7ed1a', 'You can refine the list to show only posts in a specific category or from a specific month by using the dropdown menus above the posts list. Click the Filter button after making your selection. You also can refine the list by clicking on the post author, category or tag in the posts list.', '0', '0', 'LINE', '', '10', '', '392e9b74ecaedf4daa058dcc790516c4', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8251', 'en', 'default', '3466e4fdb669b751b77cbac98d3b8a72', 'You can select an image to be shown at the top of your site by uploading from your computer or choosing from your media library. After selecting an image you will be able to crop it.', '0', '0', 'LINE', '', '10', '', '970337f1d4150e8b177c927ebf99c80b', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8252', 'en', 'default', 'ecf5914ee8ec7cfa4e0744d83a3cfb09', 'You can select the language you wish to use while using the WordPress administration screen without affecting the language site visitors see.', '0', '0', 'LINE', '', '10', '', 'fd5735268d8e29b5fb70169e194cfcba', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8253', 'en', 'default', 'bc6ead191133be47290a0774386abc1e', 'You can set a custom image header for your site. Simply upload the image and crop it, and the new header will go live immediately. Alternatively, you can use an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button.', '0', '0', 'LINE', '', '10', '', '811547aebb06fa74b5ec521c1f410710', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8254', 'en', 'default', 'ca07cec969f8aa527834073e21e414b6', 'You can set maximum sizes for images inserted into your written content; you can also insert an image as Full Size.', '0', '0', 'LINE', '', '10', '', 'a6516e825fa24e1b092cc7b8c1eabd17', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8255', 'en', 'default', '8f52d6a439157f46ebbd2782a6ce2a22', 'You can set the language, and the translation files will be automatically downloaded and installed (available if your filesystem is writable).', '0', '0', 'LINE', '', '10', '', '308e8d0b6f06c46087b020dda71cb159', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8256', 'en', 'default', '0587e968316b6f9279f46763cd67c781', 'You can still use your site but any subdomain you create may not be accessible. If you know your DNS is correct, ignore this message.', '0', '0', 'LINE', '', '10', '', '91538971a3045305eef53a3d987e6a97', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8257', 'en', 'default', '562a2da5ecf13083d751ce8dd9905d10', 'You can submit content in several different ways; this screen holds the settings for all of them. The top section controls the editor within the dashboard, while the rest control external publishing methods. For more information on any of these methods, use the documentation links.', '0', '0', 'LINE', '', '10', '', 'f86ab1682d11f3bf7e8923776b1c375c', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8258', 'en', 'default', '071fca1db11a7855fecd0ce33623604a', 'You can update to <a href="https://codex.wordpress.org/Version_%1$s">WordPress %2$s</a> automatically:', '0', '0', 'LINE', '', '10', '', 'a9f524b20e3860a4a328f0a9f7565af6', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8259', 'en', 'default', 'e4d5552eac3895bbac77d104bb1ac888', 'You can upload and insert media (images, audio, documents, etc.) by clicking the Add Media button. You can select from the images and files already uploaded to the Media Library, or upload new media to add to your page or post. To create an image gallery, select the images to add and click the &#8220;Create a new gallery&#8221; button.', '0', '0', 'LINE', '', '10', '', '63c19f99a08798af50e2a88aa8044305', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('8260', 'en', 'default', '09df6ae117e587dd779421384cd15bff', 'You can upload media files here without creating a post first. This allows you to upload files to use with posts and pages later and/or to get a web link for a particular file that you can share. There are three options for uploading files:', '0', '0', 'LINE', '', '10', '', '5f22753ed743a0fce788ebbb26a44f91', '0', '');
